import { useState, useContext } from "react";
import { Link } from "react-router-dom";
import userContext from "../utils/userContext";

export const Title = () => (
  <>
    <img
      src="https://assets.foodhub.com/static/48a74dec2132bcc4600f97a38937be05/img/1632762945phpx7NP9L.jpg"
      alt="logo"
      className="logo"
    />
  </>
);

const HeaderComponent = () => {
  const { user } = useContext(userContext);
  // we destructure the object extracting the user obj from userContext
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <>
      <nav className="nav-bar">
        <Title />
        <ul>
          <li>
            <Link to="/" className="link">
              Home
            </Link>
          </li>
          <li>
            <Link to="/About" className="link">
              About
            </Link>
          </li>
          <li>
            <Link to="/Contact" className="link">
              Contact
            </Link>
          </li>

          <li>
            <Link to="/Cart" className="cart-btn link">
              Cart
            </Link>
          </li>
        </ul>
        <p>{user.name}</p>
        <div>
          {isLoggedIn ? (
            <Link to="/reg" className="link">
              <button onClick={() => setIsLoggedIn(false)}>LogOut</button>
            </Link>
          ) : (
            <Link to="/reg" className="link">
              <button onClick={() => setIsLoggedIn(true)}>LogIn</button>
            </Link>
          )}
        </div>
      </nav>
    </>
  );
};

export default HeaderComponent;
